script: |
  super -f text -I q8688.spq | sort > q8688.out

inputs:
  - name: q8688.spq
    data: |
      SELECT DISTINCT COUNT ( * ) + COUNT ( * ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( col2 ) < - col2 + + col0 + - col0;
  - name: tab2

outputs:
  - name: q8688.out
    data: |
      6
